cs:'<uu5string />\n        Zvýrazněte libovolnou část kódu. Jednotlivé úseky zvýraznění se zapisují jako objekty v poli. Každý úsek se definuje těmito klíči:\n        <UU5.Bricks.Ul>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[číslo] startRow</UU5.Bricks.Code> - počáteční řádek (číslováno od 1)\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[číslo] startColumn</UU5.Bricks.Code> - počáteční sloupec (číslováno od 1)\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[číslo] endRow</UU5.Bricks.Code> - koncový řádek\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[číslo] endColumn</UU5.Bricks.Code> - koncový sloupec\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[string] colorSchema</UU5.Bricks.Code> - barevné schéma použito pro zvýraznění (viz <UU5.Bricks.Link href="https://uuapp.plus4u.net/uu-bookkit-maing01/ed11ec379073476db0aa295ad6c00178/book/page?code=UU5CommonColorSchemaMixin" target="_blank">seznam barevných schémat</UU5.Bricks.Link>)\n          </UU5.Bricks.Li>\n        </UU5.Bricks.Ul>\n        Pro zjednodušení je možné použít i tyto typy zápisu:\n        <UU5.Bricks.Ul>\n          <UU5.Bricks.Li>\n            číslo, např. <UU5.Bricks.Code>5</UU5.Bricks.Code> - zvýrazní řádek s daným pořadovým číslem (ekvivalent pro <UU5.Bricks.Code>{ "startRow": číslo }</UU5.Bricks.Code>)\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[řádek, "barevné schéma"]</UU5.Bricks.Code>, např. <UU5.Bricks.Code>[5, "danger"]</UU5.Bricks.Code> - zvýrazní daný řádek pomocí zadaného barevného schéma\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[řádek1, řádek2]</UU5.Bricks.Code>, např. <UU5.Bricks.Code>[5, 8]</UU5.Bricks.Code> - zvýrazní řádky od-do včetně\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[řádek1, řádek2, "barevné schéma"]</UU5.Bricks.Code>, např. <UU5.Bricks.Code>[5, 8, "danger"]</UU5.Bricks.Code> - zvýrazní řádky od-do včetně, pomocí zadaného barevného schéma\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[řádek1, sloupec1, řádek2, sloupec2]</UU5.Bricks.Code>, např. <UU5.Bricks.Code>[5, 10, 5, 20]</UU5.Bricks.Code> - zvýrazní text od-do včetně\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[řádek1, sloupec1, řádek2, sloupec2, "barevné schéma"]</UU5.Bricks.Code>, např. <UU5.Bricks.Code>[5, 10, 5, 20, "yellow"]</UU5.Bricks.Code> - zvýrazní text od-do včetně, pomocí zadaného barevného schéma\n          </UU5.Bricks.Li>\n        </UU5.Bricks.Ul>',
en:'<uu5string />\n        Highlight parts of the code. Highlight segment is defined as an object in an array. Each segment is defined with the following keys:\n        <UU5.Bricks.Ul>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[number] startRow</UU5.Bricks.Code> - initial row (numbered from 1)\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[number] startColumn</UU5.Bricks.Code> - initial column (numbered from 1)\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[number] endRow</UU5.Bricks.Code> - final row\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[number] endColumn</UU5.Bricks.Code> - final column\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[string] colorSchema</UU5.Bricks.Code> - color schema used for highlighting (see <UU5.Bricks.Link href="https://uuapp.plus4u.net/uu-bookkit-maing01/ed11ec379073476db0aa295ad6c00178/book/page?code=UU5CommonColorSchemaMixin" target="_blank">list of color schemas</UU5.Bricks.Link>)\n          </UU5.Bricks.Li>\n        </UU5.Bricks.Ul>\n        To make the insertion easier, the array item can also be inserted in the folowing ways:\n        <UU5.Bricks.Ul>\n          <UU5.Bricks.Li>\n            number, e.g. 5 – highlights a row with the given order number (equivalent for <UU5.Bricks.Code>{ "startRow": number }</UU5.Bricks.Code>)\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[row, "color schema"]</UU5.Bricks.Code>, e.g. <UU5.Bricks.Code>[5, "danger"]</UU5.Bricks.Code> – highlights a row with the given color schema\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[row1, row2]</UU5.Bricks.Code>, e.g. <UU5.Bricks.Code>[5, 8]</UU5.Bricks.Code> – highlights rows including the from-to rows\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[row1, row2, "color schema"]</UU5.Bricks.Code>, e.g. <UU5.Bricks.Code>[5, 8, "danger"]</UU5.Bricks.Code> – highlights rows including the from-to rows with the color schema\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[row1, column1, row2, column2]</UU5.Bricks.Code>, e.g. <UU5.Bricks.Code>[5, 10, 5, 20]</UU5.Bricks.Code> – highlights text including the from-to text\n          </UU5.Bricks.Li>\n          <UU5.Bricks.Li>\n            <UU5.Bricks.Code>[row1, column1, row2, column2, "color schema"]</UU5.Bricks.Code>, e.g. <UU5.Bricks.Code>[5, 10, 5, 20, "yellow"]</UU5.Bricks.Code> – highlights text including the from-to text with the color schema\n          </UU5.Bricks.Li>\n        </UU5.Bricks.Ul>'
